def get_alerts():
    responce = requests.get(f"https://api.alerts.in.ua/v1/alerts/active.json?token={ALERT_IN_UA_TOKEN}")
    responce = json.loads(responce.text)
    responce = responce['alerts']
    regions = []
    for alert in responce:
        if alert['location_oblast']:
            regions.append(alert['location_oblast'])
    return regions


def get_svg(initial_file, output_file, with_text=True):
    doc = minidom.parseString(svg)
    alerts = get_alerts()
    for path in doc.getElementsByTagName('path'):
        if path.getAttribute('name') in alerts:
            path.setAttribute('fill', alert_region_color)
    if not with_text:
        for g in doc.getElementsByTagName('g'):
            if g.getAttribute('name') == 'text':
                g.setAttribute('display', 'none')
    f = open(output_file, 'w', encoding='utf-8')
    doc.writexml(f, ' ', '')
    f.close()
    return output_file


def make_png(with_text=True):
    svg_file=get_svg('ua.svg', 'tmp.svg', with_text)
    svg2png(url=svg_file, write_to='tmp.png', background_color='transparent', dpi=200)
    os.remove(svg_file)
    return 'tmp.png'


@Client.on_message(filters.command(['map', 'карта'], prefixes=prefix) & filters.me)
async def alert_sticker_map(client: Client, msg: Message):
    await msg.delete()
    commands = msg.command[1:]
    with_text = True
    png = False
    img = False
    reply_to_message_id = None
    if msg.reply_to_message_id:
        reply_to_message_id = msg.reply_to_message_id
    if commands:
        if 'notext' in commands:
            with_text = False
        if 'png' in commands:
            png = True
    file_name = make_png(with_text=with_text)
    if not png:
        img = IMG.open(file_name)
        img = img.resize((512, 343))
        img.save(file_name.split('.')[0]+'.webp', format='webp')
        img.close()
        os.remove(file_name)
        print(img.size)
        file_name = file_name.split('.')[0]+'.webp'
        await client.send_sticker(msg.chat.id, file_name, reply_to_message_id=reply_to_message_id)
    else:
        await client.send_photo(msg.chat.id, file_name, reply_to_message_id=reply_to_message_id)

    os.remove(file_name)


